export const bars = Infinity

export default async (context) => {
  // http://ccmixter.org/content/MissJudged/MissJudged_-_The_World_Ends.mp3')
  const reverb = await Reverb(context, '/samples/impulses/r1_omni_48k.wav')
  const stutter = await Stutter(context, 1/4, 8)
  const delay = await Delay(context)
  const vocal = await fetchSample('/samples/vocals/MissJudged_-_The_World_Ends.mp3')

  let begin 
  begin = msToSamples(context, 180)
  const vocal_part_1 = vocal.subarray(
    begin, 
    begin + context.lengths.bar*2
  )
  begin = msToSamples(context, 3580)
  const vocal_part_2 = vocal.subarray(
    begin, 
    begin + context.lengths.bar*2
  )
